/* CSS code */

/* Select the body element */
body {
  font-family: 'Helvetica', Arial, sans-serif;
  background-color: #f9f9f9;
  margin: 0;
  padding: 20px;
  color: #333333;
}

/* Select all the headings */
h1, h2, h3 {
  font-weight: bold;
}

h1 {
  font-size: 32px;
  color: #0088cc;
}

h2 {
  font-size: 24px;
  color: #ff5500;
}

h3 {
  font-size: 20px;
  color: #666666;
}

/* Select all the paragraphs */
p {
  line-height: 1.5;
}

/* Select all the links */
a {
  color: #0066cc;
  text-decoration: none;
}

/* Change the link color on hover */
a:hover {
  color: #003366;
  text-decoration: underline;
}
